  user: null,
  logIn: ()=>{ },
  logOut: ()=>{ },
});

const USER = {name: "guest", isGuestUser: true};

export function UserContextProvider({children}){

  return(
    <userContext.Provider >
      {children}
    </userContext.Provider>
  )
}
